import cl from "./Button.module.css";
import  Icon from './icon.svg'


export const Button = ({
  children = "Click me",
  type,
  size,
  variant,
  disabled,
  startIcon,
  endIcon
}) => {

  return (
    <button
      className={[cl.button, cl[size], cl[variant], cl[type]].join(" ")}
      disabled={disabled}
      >
     {startIcon ? <img src={Icon}  alt="" className={cl.svgStart}></img> : ""}
      {children}
      {endIcon ? <img src={Icon}  alt="" className={cl.svgStart}></img> : ""}
    </button>
  );
};
